import { Col, Row } from "antd";

const CentralAppLayout = ({ children }) => (
  <Row gutter={16}>
    <Col xs={0} md={6} />
    <Col xs={24} md={12}>
      {children}
    </Col>
    <Col xs={0} md={6} />
  </Row>
);

export default CentralAppLayout;
